import { BrowserRouter, Routes, Route } from "react-router-dom";
import ManagerPage from "./pages/MangerPage";
import LoginPage from "./pages/LoginPage";
import SelectRoom from './pages/SelectRoom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="manager" element={<ManagerPage />} />
        <Route path="selectRoom" element={<SelectRoom />} />
        <Route path="reception" element={<ManagerPage />} />
        <Route path="doctor" element={<ManagerPage />} />
        <Route path="treatment" element={<ManagerPage />} />
        <Route path="triage" element={<ManagerPage />} />
        <Route path="ecg" element={<ManagerPage />} />


      </Routes>
    </BrowserRouter>
  );
}
export default App;
